import React from 'react';
import './Resume.css';

const Resume = () => {
  return (
    <section id="resume" className="resume">
      <h2>Resume</h2>
      <p>
        You can download my resume by clicking the link below:
      </p>
      <a href="path/to/your/Ryan_Smith_Resume.pdf" download="Ryan_Smith_Resume.pdf" className="resume-link">
        Download Resume
      </a>
    </section>
  );
};

export default Resume;
